import React, { useState } from "react";
import { AppBar, Autocomplete, Tab, Tabs, TextField } from '@mui/material';
import { Box, Toolbar } from '@mui/material';
import MovieIcon from '@mui/icons-material/Movie';
import getAllMovies from '../Api Helper/apiHelp';
// import  from '@mui/system';


const Header = () => {
    const top100Films = ["abc", "hshfj", "dagf"];
    const [value,setValue]=useState(0);
    useEffect(()=>{getAllMovies})
    return (<>
        <AppBar sx={{bgcolor:"#2b2d42"}}>
            <Toolbar>
                <Box width={"20%"}><MovieIcon /></Box>
                <Box width={"50%"} margin={"auto"}>
                    <Autocomplete id="free-solo-demo" freeSolo options={top100Films.map((option) => option)} renderInput={(params) => (<TextField sx={{input:{color:"white"}}} {...params} label="Search Across Multiple Movies" />)} />
                </Box>
                <Box display={"flex"}>
                    <Tabs textColor="inherit" indicatorColor="secondary" value={value} onChange={(e,val)=>setValue(val)}>
                        <Tab label="Movies" />
                        <Tab label="Admin" />
                        <Tab label="Auth" />
                    </Tabs>
                </Box>
            </Toolbar>
        </AppBar>
    </>
    )
}

export default Header
